import React from "react";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import SignupForm from "./components/signup/signup";
import Dashboard from "./components/dashoboard/dashboard";
import NotFound from "./components/NotFound/NotFound";
import Header from "./components/header/header";
import Footer from "./components/footer/footer";

import "./App.css";
import LoginForm from "./components/login/login";
import UserDetails from "./components/userDetails/userDetails";
import Account from "./components/Account/Account";
import AddUser from "./components/dashoboard/addUser/addUser";
import EditUserDetails from "./components/dashoboard/EditUserDetails/EditUserDetails";
import ProtectedRoute from "./components/ProtectedRoute";

const App = () => {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Routes>
          <ProtectedRoute path="/" element={<SignupForm />} />
          <Route path="/login" element={<LoginForm />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/user-details/:userId" element={<UserDetails />} />
          <Route path="/add-user" element={<AddUser />} />
          <Route path="/edit-user/:userId" element={<EditUserDetails />} />
          <Route path="/account" element={<Account />} />
          <Route path="*" element={<NotFound />} />
        </Routes>
        <Footer />
      </BrowserRouter>
    </div>
  );
};

export default App;
